def longes_palindrome_PASSED(s):
# def longest_palindrome(s):
    """
    :type s: str
    :rtype: str
    """
    def is_pal(s):
        return s == s[::-1]

    def scan_even(idx):
        ret = s[idx:idx+2]
        l = idx - 1
        r = idx + 2
        while l >= 0 and r < _len and s[l] == s[r]:
            ret = s[l:r+1]
            l -= 1
            r += 1
        return ret

    def scan_odd(i):
        ret = s[i-1:i+2]
        l = i-1
        r = i+1
        while l >= 0 and r < _len and s[l] == s[r]:
            ret = s[l:r+1]
            l -= 1
            r += 1
        return ret


    """ ENTER HERE """
    _len = len(s)
    if _len == 1 or is_pal(s):
        return s
    ret_len = 0
    retval = ""

    if s[0] == s[1]:
        ret_len = 2
        retval = s[0:2]

    i = 1
    while i < _len:
        if s[i:] == (s[i] * (_len-i)) and (_len-i) > ret_len:
            return s[i:]
        if i < _len - 1 and s[i] == s[i+1]:
            tmp = scan_even(i)
            if len(tmp) > ret_len:
                ret_len = len(tmp)
                retval = tmp

        if (0 < i < _len - 1) and (s[i-1] == s[i+1]):
            tmp = scan_odd(i)
            if len(tmp) > ret_len:
                ret_len = len(tmp)
                retval = tmp

        i += 1
    return retval

